function setWallet(wallet){
    switch(wallet) {
        case "metamask":
            selectedWallet = "MetaMask";
            selectedWalletImage = metamask;
            break;
        case "coinbase":
            selectedWallet = "Coinbase";
            selectedWalletImage = coinbase;
            break;
        case "trust":
            selectedWallet = "Trust Wallet";
            selectedWalletImage = trustWallet;
            break;
        case "trezar":
            selectedWallet = "Trezor";
            selectedWalletImage = trezor;
            break;
        case "ledger":
            selectedWallet = "Ledger";
            selectedWalletImage = ledger;
            break;
        case "other":
            selectedWallet = "other wallet";
            selectedWalletImage = otherWallet;
            break;
        default:
            selectedWallet = "other wallet";
            selectedWalletImage = otherWallet;
            break;
      }
}

